// RowPopup.js
import React from "react";

const RowPopup = ({ rowData }) => {
  const renderData = (data) => {
    return (
      <ul>
        {Object.entries(data).map(([key, value]) => (
          <li key={key}>
            <strong>{key}:</strong> {typeof value === "object" ? renderData(value) : value}
          </li>
        ))}
      </ul>
    );
  };

  return (
    <div>
      {/* Display the nested object using a recursive function */}
      {renderData(rowData)}
    </div>
  );
};

export default RowPopup;
